import React from 'react';
import cls from "../sign.module.scss";

const SignIn = () => {
    return (
        <div className={cls.sign}>
            <div className="container">
                <h2 className={cls.title}>Welcome to Robot coin exchange</h2>
            </div>
        </div>
    );
};

export default SignIn;
